        return `Promise.resolve(require("./" + ${relativePathExpr}))`;
      }

      return `require(${JSON.stringify(
        loader,
      )})(require('./bundle-url').getBundleURL() + ${relativePathExpr})`;
    })
    .filter(Boolean);

